import React, { useState, useEffect, useRef } from "react";
import analysis from "../images/medical-analysis.jpeg"
import HoverImage from "./HoverImage";
import funfact from "../images/funfact.png";

const { tableau } = window;


function Scenario3(){
  const url = 'https://public.tableau.com/views/Rent_16847608524380/Dashboard3';
  const ref = useRef(null);

  const initViz = () => {
    new tableau.Viz(ref.current, url, {
      width: "100%",
      height: "100%"
    });
  };

  useEffect(initViz, []);

  return (
    <div className="embed">
      <h1 className="embed_heading">Rental rates in Melbourne</h1>
      <div className="viz-container" ref={ref} />
      <div className="content">
      <h1 className="content_heading">Scenario Analysis</h1>
       <div className="image-container">
          <img className="image" src={analysis} alt="Image 1" />
          <p className="image-description">We have plotted the top 5 sentiments and bottom 5 sentiments based on twitter data. After analysing the average rental affordability index with respect to sentiments calculated we came to the conclusion that Yarrawonga, Victoria has the highest sentiment of 0.17 followed by Geelong, Victoria and Portarlington, Victoria with 0.15 and 0.13 respectively, While the Warrangul, Bendigo and Benalla in Victoria has the lowest sentiments score with score of -0.07, -0.05 and -0.04 respectively. This twitter sentiment score when compared to Sudo data on Rental affordability index of different regions we concluded that Yarrawonga has RAI of 120k while Geelong and Portarlington has RAI of 112k and 109k leading to Top 3 positive sentiments whereas Warrangul, Bendigo and Benalla have RAI of 122k, 124k, 129.8k respectively.</p>
      </div> 
      <HoverImage
        imageSrc={funfact}
        popupContent={<p>Land prices can make you do a double-take and question if you're buying real estate or a ticket to outer space! Sometimes, it feels like you need a rocket ship to afford a piece of land. It's like the properties have their own secret mission to blast your wallet into orbit! So, buckle up and get ready for a wild ride when exploring land prices in Melbourneâ€”they're truly out of this world!.</p>}
      />
      </div>
    </div>
  );
}


export default Scenario3;
